import React from 'react';
//import { Header } from '../home-element/Header';
//import { Footer } from '../home-element/Footer';
import TextField from '@material-ui/core/TextField';
import { makeStyles } from '@material-ui/core/styles';


/*
* Purpose: Estilo predefinido/predeterminado. 
*/
const useStyles = makeStyles((theme) => ({
    root: {
      '& .MuiTextField-root': {
        margin: theme.spacing(1),
        width: '25ch',
      },
    },
  }));

/**
  *  @author : juan felipe osorio zapata <juan.felipe.osorio@correounivalle.edu.co>
  *  @decs  : Componente de categorias de las personas dentro de la App. 
*/

export function Categorias(props) {
    const classes = useStyles();

    /*
    return (
            <div>
            <form className={classes.root} noValidate autoComplete="off">
            <TextField id="standard-basic" label="Estandar" />
            <TextField id="filled-basic" label="Filled" variant="filled" />
            <TextField id="outlined-basic" label="Outlined" variant="outlined" />
            </form>
            </div>
    )
    */
    return (

        <form className={classes.root} noValidate autoComplete="off">
        <div>
        <h1>Categorias:</h1>
        </div>
          <div>
            <TextField
              required
              id="outlined-required"
              label="Nombre"
              defaultValue="Digita tu nombre"
              variant="outlined"
            />
            <TextField
              disabled
              id="outlined-disabled"
              label="Disabled"
              defaultValue="Hello World"
              variant="outlined"
            />
            <TextField
              id="outlined-password-input"
              label="Password"
              type="password"
              autoComplete="current-password"
              variant="outlined"
            />
            <TextField
              id="outlined-read-only-input"
              label="Read Only"
              defaultValue="Hello World"
              InputProps={{
                readOnly: true,
              }}
              variant="outlined"
            />
            <TextField
              id="outlined-number"
              label="Number"
              type="number"
              InputLabelProps={{
                shrink: true,
              }}
              variant="outlined"
            />
            <TextField id="outlined-search" label="Search field" type="search" variant="outlined" />
            <TextField
              id="outlined-helperText"
              label="Helper text"
              defaultValue="Default Value"
              helperText="Some important text"
              variant="outlined"
            />
          </div>
        </form>
      );
}
